import React from "react";
import { Grommet, Main, Text, Image, Box } from "grommet";
import image from "./image/IMG_9079.jpg";

function Home() {
  return (
    <Grommet>
      <Main>
        <Text>Wellcome!!!</Text>
        <Box height="medium" width="medium">
          <Image fit="cover" src={image} />
        </Box>
      </Main>
    </Grommet>
  );
}

export default Home;
